  let finalscore = 0;
  let currentQuestionIndex = 0;
  const questionDiv = document.querySelector('#question');
  const imagesDiv = document.querySelector('#images');
  const form = document.querySelector('form');
  const guessInput = document.querySelector('#guess');
  const result = document.querySelector('#result');
  
  form.addEventListener('submit', (event) => {
    event.preventDefault();
    let guess1 = guessInput.value;
    let guess=guess1.toLowerCase();
    if (guess === questions[currentQuestionIndex].answer) {
      finalscore+=1;
      result.textContent = 'Correct! Your score is'+finalscore;
      result.classList.remove('incorrect');
      result.classList.add('correct');
      currentQuestionIndex += 1;
      if (currentQuestionIndex === questions.length) {
        result.textContent = 'You have completed all the questions. Your score is'+finalscore+" Click Here to Move to Next Round";
        result.style.cursor="pointer";
        form.style.display = 'none';
        result.addEventListener('click', function() {
            // window.location.href='google.com';
            window.location.assign('round8.php');
          });
      } else {
        showQuestion();
      }
    } else {
      result.textContent = 'Incorrect. Try again. Your score is '+finalscore;
      result.classList.remove('correct');
      result.classList.add('incorrect');
    }
    guessInput.value = '';
  });
  
  var nxt = document.getElementById("nextqs");
  nxt.onclick = function(){
    if(currentQuestionIndex!=questions.length){
        result.textContent = 'Your score is '+finalscore;
        currentQuestionIndex+=1;
        showQuestion();
    }
  };

  var prev = document.getElementById("prevqs");
  prev.onclick = function(){
    if(currentQuestionIndex!=0){
        result.textContent = 'Correct! Your score is '+finalscore;
        currentQuestionIndex-=1;
        showQuestion();
    }
  };

  function showQuestion() {
    const currentQuestion = questions[currentQuestionIndex];
    questionDiv.textContent = currentQuestion.question;
    imagesDiv.innerHTML = '';
    for (let i = 0; i < currentQuestion.images.length; i++) {
      const image = document.createElement('img');
      image.src = currentQuestion.images[i];
      imagesDiv.appendChild(image);
    }
  }
  
  showQuestion();
  
  